import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'angularXuxemons';
}
<div class="container">
  <h1>Bienvenido</h1>
  <button routerLink="/login" class="btn btn-primary">Home</button> <!-- Puedes cambiar la ruta al home si deseas -->
  <button routerLink="/login" class="btn btn-primary">Login</button>
  <button routerLink="/register" class="btn btn-primary">Register</button>
  <button routerLink="/xuxedex" class="btn btn-primary">Xuxedex</button>
  <router-outlet></router-outlet>
</div>
